
use alloy::sol;

sol! {
    #[sol(rpc, abi, deployed_bytecode="")]
    #[derive(Debug)]
    interface IProxy {

        struct CallArgument {
            address callee;
            bytes argument;
            uint256 value;
            uint256 gas;
        }
  
        function execute(CallArgument[]) returns (bytes[]);
    }
}